import React from 'react';

const CollapsePanel = (props) => {
   const {title, unique_id} =  props  
    return (
        <div class={"container"}>
            <div id={unique_id} class="accordion">
                <div className="card border-light shadow-sm bg-white rounded mb-2">
                    <div class="card-header collapsed" data-toggle="collapse" href={"#" + `${unique_id}`}>
                        <a class="card-title">
                            {title}
                        </a>
                    </div>
                    <div id={unique_id} class="card-body collapse" data-parent="#accordion" >
                        {props.children}
                    </div>
                </div>
            </div>
        </div>
    );
}

export default CollapsePanel;
